class FlashMarketModel {
  FlashMarketModel({
      String? status, 
      String? message, 
      Result? result, 
      num? notificationCount, 
      num? cartCount,}){
    _status = status;
    _message = message;
    _result = result;
    _notificationCount = notificationCount;
    _cartCount = cartCount;
}

  FlashMarketModel.fromJson(dynamic json) {
    _status = json['status'];
    _message = json['message'];
    _result = json['result'] != null ? Result.fromJson(json['result']) : null;
    _notificationCount = json['notificationCount'];
    _cartCount = json['cartCount'];
  }
  String? _status;
  String? _message;
  Result? _result;
  num? _notificationCount;
  num? _cartCount;
FlashMarketModel copyWith({  String? status,
  String? message,
  Result? result,
  num? notificationCount,
  num? cartCount,
}) => FlashMarketModel(  status: status ?? _status,
  message: message ?? _message,
  result: result ?? _result,
  notificationCount: notificationCount ?? _notificationCount,
  cartCount: cartCount ?? _cartCount,
);
  String? get status => _status;
  String? get message => _message;
  Result? get result => _result;
  num? get notificationCount => _notificationCount;
  num? get cartCount => _cartCount;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['status'] = _status;
    map['message'] = _message;
    if (_result != null) {
      map['result'] = _result?.toJson();
    }
    map['notificationCount'] = _notificationCount;
    map['cartCount'] = _cartCount;
    return map;
  }

}

